import React from "react";
import jobliststyle from "./joblist.css";
const Joblist=({firstname,state,address,lastname,pnumber})=>{



        return(
            <div id="joblistdiv" style={jobliststyle}>
              <div style={{width:"100%", color:"green"}}> 
              <h2 style={{textAlign:"left"}}>State: {state}</h2>
              </div>

              <div>
              <p style={{fontSize:"bold"}}>Address:{"" +" "} {address}{"" +" "}
              {"" +" "} firstname:{"" +" "} {firstname}
              {"" +" "}lastname:{"" +" "}{lastname}
              {"" +" "}  Phone Number:{"" +" "} {pnumber}</p>
              </div>


            </div>
          )






}

export default Joblist;
